import React from 'react';
import '../App.css';
import { Link } from "react-router-dom";
import Login from "../components/Login";

function Home() {
	return(
		<header className="App-header">
			<img src="images/Nooth_DnD.png" className="App-logo" alt="logo" />
			<h1>
				DnD20
			</h1>
			<Login />
			<p>{fetch('/ping')}</p>
			<Link to="/SomePage">
				<button variant="outlined">
					Go to Some Page
				</button>
			</Link>
		</header>
		)
}

export default Home;
